import React from 'react'

const CreateArea = () => {
    return (
        <div>
            <form>
                <input name="title" placeholder="Title"/>
                <textarea name="content" placeholder="Add a note..."/>
                <button>ADD</button>
            </form>
        </div>
    )
}

export default CreateArea
